import React from 'react';
import './App.css';
import {Link} from 'react-router-dom';
import Routes from './Routes.js';
import Home from './Container/Home';

function App() {
  return (
    <div>
      <ol>
        <li><Link to="/">Home</Link></li>
        <li><Link to="/accueil">Accueil</Link></li>
      </ol>
      <Routes/>
    </div>
  );
}

export default App;
